import React, { Component } from 'react'

export default class Header extends Component {
    render() {
        return (
            <div className="RCA-header-container">
                <h2>
                    {this.props.calendarYM}
                </h2>
                <h3>
                    {this.props.today}
                </h3>
            </div>
        )
    }
}
